import "./App.css";
import { Bio } from "./components/Bio";
import { Projects } from "./components/Projects";
import { Skills } from "./components/Skills";
import { Education } from "./components/Education";

function App() {
  return (
    <div>
      <Bio />
      <Projects />
      <Skills />
      <Education />
      <div className="App">
        <section class="passetemps">
          <h5>Things I like</h5>
          <ul>
            <li>Playing Piano</li>
            <li>Climbing</li>
            <li>Cooking</li>
          </ul>
        </section>
      </div>
    </div>
  );
}

export default App;
